import React from 'react';
import ProjectItem from './ProjectItem';

class Project extends React.Component {
  deleteProject(id) {
    this.props.onDelete(id);
  }

  render() {
    let projects = this.props.projects
    let filterText = this.props.filterText;
    let isCompleted = this.props.isCompleted;
    let projectItems;

    projectItems = projects.map(project => {
      if(project.title.toLowerCase().indexOf(filterText) === -1) {
        return };
      // if(!isCompleted && !project.completed) { return };
      //checked => true && project completed => true
      //checked => true && not completed => false
      //checked => false && not completed => true
      //checked => false && not completed => false
      console.log(project);
      return (
        <ProjectItem key={project.id} project={project} onDelete={this.deleteProject.bind(this)} />
      )
    });


    return (  
      <ul className="Project">
        {projectItems}      
      </ul>
    );
  }  	
}

export default Project;
